import React from "react";
import ReactPaginate from "react-paginate";

let Pagination = () => {
    return (
        <>
            < div div className="col-12 pagination d-flex justify-content-center" >
                <ReactPaginate
                    prevPageRel={'previous'}
                    nextLabel={'next'}
                />
            </div >
        </>
    );
}

export default Pagination;
